        public VedumData(string DocumentOriginalName, string DocumentNewName, string Title, string DocumentType, string vedProcessOwner, string vedContentManager, string vedRevisionInitiator,
            string vedProcess, string vedOldDocumentId, string vedOldCreateDate, string ODMApprovedBy, string ODMPublishedBy, string ODMPublished, string TemplateName, string convertedPDF)
        {
            this.Title = Title;
            this.DocumentOriginalName = DocumentOriginalName;
            this.DocumentNewName = DocumentNewName;
            this.DocumentType = DocumentType;
            this.vedProcessOwner = vedProcessOwner;//title as well
            this.vedContentManager = vedContentManager;//nno need
            this.vedRevisionInitiator = vedRevisionInitiator;
            this.vedProcess = vedProcess;
            this.vedOldDocumentId = vedOldDocumentId;
            this.vedOldCreateDate = vedOldCreateDate;
            this.ODMApprovedBy = ODMApprovedBy;
            this.ODMPublishedBy = ODMPublishedBy;
            this.ODMPublished = ODMPublished;
            this.TemplateName = TemplateName;
            this.ConvertedPDF = convertedPDF.ToLower() == "yes" ? true : false;
        }

        public static ListItemSimple UpdateData(ListItemSimple listItem, List<FieldInfoValue> fieldsValues, VedumData dataforCurrentItem)
        {
            foreach (var field in fieldsValues)
            {
                switch (field.DocumentTypeFieldTitle)
                {
                    case "Namn":
                        listItem.NewName = dataforCurrentItem.DocumentNewName;
                        break;
                    case "Rubrik":
                        field.Value = dataforCurrentItem.Title;
                        break;
                    case "Processägare":
                        field.Value = dataforCurrentItem.vedProcessOwner;
                        break;
                    case "Innehållsansvarig":
                        field.Value = dataforCurrentItem.vedContentManager;
                        break;
                    case "Revideringsinitierare":
                        field.Value = dataforCurrentItem.vedRevisionInitiator;
                        break;
                    case "Process (DM)":
                        field.Value = dataforCurrentItem.vedProcess;
                        break;
                    case "Tidigare dokument-id":
                        field.Value = dataforCurrentItem.vedOldDocumentId;
                        break;
                    case "Tidigare skapatdatum":
                        field.Value = dataforCurrentItem.vedOldCreateDate;
                        break;
                }
            }
            return listItem;
        }
    }
